import axios from "axios";

export const login=(data)=>{
    return axios.post(`${process.env.REACT_APP_ENV_VARIABE}`+`/employee/login`,data);
}

export const changePassword=(id , data)=>{
    return axios.post(`${process.env.REACT_APP_ENV_VARIABE}`+`/employee/changepass/${id}`,data);
}
